import React from 'react'
import styled from 'styled-components'
import { faArrowRight } from '@fortawesome/free-solid-svg-icons'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

const FrameCard = styled.div`
  width: 27%;
  display: flex;
  flex-wrap: wrap;
  flex-direction: column;
  padding: 1.5em;
  padding-top: 2em;
  margin-top: 2.3em;
  backdrop-filter: blur(32px);
  background: hsla(0,0%,97%,.6);
  border-radius: 8px;

  p{
    font-weight: 300;
    font-size: .85em;
    line-height: 1.5;
    color: #393939;
  }

  button{
    text-align: left;
  }
`

const Image = styled.img`
  width: 15%;
`

const Title = styled.h3`
  font-size: 1.5em;
  margin: 0;
  padding: 0;
  margin-top: 1.5em;
  font-family: Ruberoid;
`

const Buttons = styled.div`
  display: flex;
  gap: .5em;
  margin-top: 4em;
  flex-direction: column;
`

function BuildCard({framework}) {
  return (
    <FrameCard>
        <Image src={framework.logo} alt={framework.title}/>
        <Title>{framework.title}</Title>
        <p>{framework.sub}</p>
        <Buttons>
          {framework.button.length === 0 && <p>Coming soon</p>}
          {framework.button && framework.button.map((button) => {
              return(<button>{button} <FontAwesomeIcon icon={faArrowRight}/></button>)
          })}
        </Buttons>

    </FrameCard>
  )
}

export default BuildCard
